import React from 'react';
import './App.css';
import NavBar from './components/layout/NavBar';
import Home from './components/layout/Home';
import Spinner from './components/layout/Spinner';
import Alerts from './components/layout/Alert';
function App() {
  return (
    <div className='App'>
      <NavBar />
      <Spinner />
      <Alerts />
      <Home />
    </div>
  );
}

export default App;
